(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0c8442"],{"53c1":function(e){e.exports=JSON.parse('{"6ba37b5f-bdd4-47e1-9c6e-076795d3e2b5":{"html":"Quality - Commercialize the Product"},"d27b5651-8fdd-4663-a7d8-e7851d139aed":{"html":"Play the audio to listen to the team’s conversation."},"845ce168-a23e-44b8-9775-201e41c0a0ba":{"html":"What is Commercialization?"},"a9509753-8c24-4cd1-b1a6-8c64f40dc36c":{"html":"<p>Let’s get started by exploring some concepts and definitions to build a good foundation of knowledge.</p>"},"56c03f61-3f3f-4696-8910-d6d9a997e3d2":{"html":"You completed your journey!"},"7c312225-90bd-450a-8016-8295cc56a4b3":{"html":"<p>Congratulations! You navigated the new product commercialization of the painting tape from start to finish: From BBC to post-Launch. You applied your knowledge of Quality tools, systems, and responsibilities to work with your team.</p><p>Next, let’s review your results.</p>"},"05b9119f-69bc-4223-bfe8-3b88e02cc653":{"html":"Continue"},"284652d2-b0b6-40dc-a5ef-2b42b1c2f164":{"html":"Try Again"},"04c85394-475d-45f6-9c5c-8ca7fc20f316":{"html":"It looks like you could have performed better."},"0be51085-bef9-49a4-80ff-fa4a3f0e3fa4":{"html":"<p>It looks like you struggled to achieve high success in this scenario. You may have opportunities to expand on your knowledge of how the Quality focus contributes to new product commercialization.</p><p>To make sure you have the basics you will want to visit some of the questions you’ve missed. You may also want to re-explore previous lessons in the course to aid you in making the best choices.</p>"},"aa3e5223-f2b6-401d-91c0-8b1b3928593b":{"html":"You Might Want to Review"},"d19f72dd-5687-45a9-8628-15014194ca09":{"html":"<p>You demonstrated knowledge of how the Quality focus contributes to new product commercialization, but there is an opportunity to reach better results in this scenario.</p><p>To make sure you’ve got a mastery of the Quality mindset, you may want to visit some of the questions you’ve missed. </p><p>When you are ready, you may proceed to the conclusion.</p>"},"9bade05d-7e8f-4702-8ad3-eb13e266d4cb":{"html":"Your effort was highly successful!"},"d3e10c7c-4aa4-418c-ae07-8f36e9eb344d":{"html":"<p>You’ve demonstrated thorough knowledge of how the Quality focus contributes to new product commercialization.</p><p>If you wish, you can revisit questions if you missed them. Otherwise, you may proceed to the conclusion.</p>"},"5181920d-529d-4c9a-9c96-23de347ba9d3":{"html":"Your effort was highly successful!"},"d916eab2-b3e5-4810-a7de-3a29fde4ac8d":{"html":"<p>You’ve demonstrated thorough knowledge of how the Quality focus contributes to new product commercialization.</p><p>If you wish, you can revisit questions if you missed them. Otherwise, you may proceed to the conclusion.</p>"},"6f326bab-1130-498c-b76e-4b516b419f8a":{"html":"You can listen again by selecting any of the outlined team members."},"5ef60727-0448-4da0-a9c6-f95029a7d5bb":{"html":"Continue"},"ddb6bd2d-1e5a-4599-b441-33789c80cd1e":{"html":"Legal"},"1ccc0932-ff31-4146-9f03-1d6054a35d17":{"html":"Manufacturing"},"7b33a031-cef4-4156-82a0-e96cffa96b36":{"html":"Product Stewardship"},"e0cd7ef6-2306-45ce-81d7-e316c111d224":{"html":"Marketing & Business"},"b7471930-3a4e-4b6f-a227-156b3f1968c7":{"html":"Quality"},"65b495f1-dc97-4776-b04c-a2dd0f18d03e":{"html":"Lab"},"89561b8d-90df-4435-89df-c85e1b205624":{"html":"Build Business Case"},"1f23c388-9f1a-4508-badb-6436a5a6d2dd":{"html":"Marketing & Business"},"7bfc39d9-db25-4bf9-9f27-234757f5f0ea":{"html":"Marketing & Business"},"373493a6-115c-4603-be61-1c79c99b6117":{"html":"<p>Team, we’ve collected and compared the information we gathered in Discover. Let’s get to work on Building the Business Case for this new painter’s tape we hope to take to Launch.</p><p>I’ll contribute to our feasibility assessment from the business perspective.</p><p>Quality, we’ll need your help in translating the voice of the customer into the voice of the process. Be on the lookout for any opportunities you see to guide us.</p>"},"15e3130b-8670-4ee0-bdc9-58e3ca7d9cf7":{"html":"Lab"},"605ed2b1-ee35-406f-bea5-8461a81985ae":{"html":"Lab"},"ffad414a-5c56-420f-9981-89021f36d801":{"html":"<p>I’ll be awaiting the information we’ll need to begin identifying our product targets and specifications.</p>"},"50a8aba6-0621-4943-a913-8b9a4237c0a6":{"html":"Product Stewardship"},"58293a86-bc46-4359-afcd-8e505381a6ec":{"html":"Product Stewardship"},"c1559830-6c91-4f94-87af-cc0d16f3ca3e":{"html":"<p>Since we know the type of product and the primary market, I can begin identifying the legal requirements.</p>"},"747a18fb-3e77-4c50-8df7-7ebdc2167e8a":{"html":"Legal"},"45b85859-db9d-4ade-9eee-335c99608f03":{"html":"Legal"},"1f0b15d5-7ba8-4b90-84a4-d1d465e499d2":{"html":"<p>I can begin evaluating product sustainability once we have the product specifications.</p>"},"935fa1ca-d16b-413a-a9ac-62b7a360b09f":{"html":"Manufacturing"},"ae8dab89-f162-4c58-acc0-f8ab1f1f6616":{"html":"Manufacturing"},"fd21d0eb-3326-485e-ab33-c63471e12f09":{"html":"<p>I will be on the lookout for raw material testing.</p>"},"bf681103-44bc-4262-bcc6-9179addb71ef":{"html":"Development"},"0f7a92ba-fc4f-428b-8990-02a2f462508d":{"html":"Lab"},"5c1db843-bb90-4067-9978-9f835caed665":{"html":"Lab"},"bd6a63ff-b4d8-4d32-8b40-44166061da9e":{"html":"<p>Now that we are in Development, we are well underway with design specification verification. Some of our field testing is returning mixed results. Quality, I’ll need your help to diagnose the problem.</p>"},"51c48653-7c31-4a1f-b830-b814cfa2f0f6":{"html":"Manufacturing"},"0e30886b-d6ec-4f75-bfec-cd237aac85ce":{"html":"Manufacturing"},"17ef53af-3771-41ae-b574-6900cb237665":{"html":"<p>We are also formulating our approach to raw material selection and I could use help in ensuring we do not encounter one of the material failure modes we identified in the FMEA.</p>"},"d52ecd80-fdb9-4c02-99b3-f5ee873505ce":{"html":"Product Stewardship"},"bb80006e-fb02-46ad-9d44-18840190df18":{"html":"Product Stewardship"},"26998226-f668-4093-b3a6-285a525f0531":{"html":"<p>Since Lab is sharing that field testing is having some unexpected results, we will need to make sure our proposed product claims are accurate. Quality, I’m sure you’ll have insight into this once we review the findings.</p>"},"b6a2e714-a078-4150-acb9-bd1a37214c07":{"html":"Scale Up"},"e715bf09-2452-47c4-ba0f-ce63802ece4d":{"html":"Legal"},"ecf7f892-8843-4936-85e8-c69952b12f37":{"html":"Legal"},"e67070fb-19db-48ea-bf0c-3fa073aaf94c":{"html":"<p>I’d like to congratulate the team on entering Scale Up. I’ve completed IP and Freedom to Operate checks on the painting tape and it appears that we have no challenges.</p>"},"f5564455-c065-460e-a5a6-8861f5857988":{"html":"Lab"},"baec44e9-5016-4250-9ee9-edb575e0b877":{"html":"Lab"},"a68f7ce4-55df-495d-a2a9-577d494476b3":{"html":"<p>There are some process capability questions that have arisen. Quality, we could use your guidance.</p>"},"2661d818-a4b9-4669-b225-d16cbb0006b7":{"html":"Manufacturing"},"915d9be8-2231-4a74-83ae-366341675373":{"html":"Manufacturing"},"c27a119f-79b3-493c-8f8e-fd1a0112a89f":{"html":"<p>We may have uncovered some concerns with one of our chief suppliers that I’d like to review with Quality.</p>"},"12fdae57-c416-4837-903b-2007483c46d7":{"html":"Launch"},"ea777d0b-d8ed-44cb-811a-43ed69f85bd1":{"html":"Marketing & Business"},"6eaaf823-cee3-4e41-aeaf-7eafc86cffab":{"html":"Marketing & Business"},"cb9af4ec-0c28-48d1-8182-f347194b3be3":{"html":"<p>Team, while the Launch of the tape has largely been successful, we have some improvement opportunities based on our KPIs.</p><p>Customer feedback indicates that we may have some variation in the adhesion quality of the tape. and surprisingly, the tape isn’t a preferred reflective color. This needs investigation.</p><p>Finally, were aware of a product failure in one of our submarkets. It appears that adhesive glue is melted inside of the packaging when customers rfirst open it.</p><p>Quality, we’ll look to you to investigate these issues and help guide what interventions we should take.</p>"},"b4a4c3ac-b5d7-4b02-a94c-d228ee7787d6":{"html":"Manufacturing"},"59b15ef7-78cf-4c42-8e93-35d03a01a8af":{"html":"Manufacturing"},"89bae316-dac0-403c-b594-84501d44c032":{"html":"<p>If part of the problem is product specification variation falling outside of our defined limits, we will need to check our Manufacturing Control Plan. Quality, I could use your help to identify where we may have an issue.</p>"}}')}}]);
